  return 8;
}

function richer_default_presets() {
  return '';
}

function richer_default_layouts() {
  return '';
}

function richer_preprocess_node(&$variables) {

  $node = $variables['node'];
  // Display post information only on certain node types.
  if (variable_get('node_submitted_' . $node->type, TRUE)) {
    if ($node->type == "article") {
      if (!empty($node->field_blog_categories)) {
        $categories = richer_format_comma_field('field_blog_categories', $node);
        $variables['blog_categories'] = $categories;
      }
    }
  }
}

function richer_format_comma_field($field_category, $node, $limit = NULL) {
  $category_arr = array();
  $field = field_get_items('node', $node, $field_category);
  if (!empty($field)) {
    foreach ($field as $item) {
      $term = taxonomy_term_load($item['tid']);
      if ($term) {
        if (module_exists('i18n_taxonomy')) {
          $term_name = i18n_taxonomy_term_name($term, $node->language);
        } else {
          $term_name = $term->name;
        }
        $category_arr[] = l($term_name, 'taxonomy/term/' . $item['tid']);
      }
      if ($limit) {
        if (count($category_arr) == $limit) {
          $category = implode(', ', $category_arr);
          return $category;
        }
      }
    }
  }
  $category = implode(', ', $category_arr);
  return $category;
}

/**
 * Implement hook_form_comment_form_alter().
 */
function richer_form_comment_form_alter(&$form, &$form_state, $form_id) {
  $form['actions']['submit']['#value'] = t('SEND MESSAGE');
}

function richer_preprocess_html(&$vars) {
  //Process portfolio color
  if ($portfolio_category = taxonomy_vocabulary_machine_name_load('portfolio_category')) {
    $terms = taxonomy_get_tree($portfolio_category->vid);
    $less = new lessc();
    $css = '';
    $color = '';
    $class = '';
    foreach ($terms as $t) {
      $term = taxonomy_term_load($t->tid);
      $class = drupal_html_class($t->name);
      if (!empty($term->field_color)) {
        foreach ($term->field_color as $v) {
          $color = $v[0]['value'];
          break;
        }
      }
      if ($color) {
        $css .= ".dexp-masonry-filter,.dexp-portfolio-filter{.{$class} span:before{background-color: {$color} !important;}}";
        $css .= ".{$class} .portfolio-item-overlay{background-color: rgba(red({$color}), green({$color}), blue({$color}), 0.7) !important;}";
      }
    }
    $css = $less->compile($css);
    drupal_add_css($css, array('type' => 'inline'));
  }
}

function richer_form_search_block_form_alter(&$form) {
  $form['search_block_form']['#attributes']['placeholder'] = t('Search...');
}
function richer_form_alter(&$form, $form_state, $form_id) {
	if( $form_id == 'user_login' ) {
		$form['name'] = array(
			'#type' => 'textfield',
			'#title' => t('Username'),
			'#size' => 60,
			'#maxlength' => USERNAME_MAX_LENGTH,
			'#required' => TRUE,
		);
		$form['name']['#description'] = t('Enter your @s username.', array('@s' => variable_get('site_name', 'Drupal')));
	}
}